import React, { Component } from "react";
import "./NoticeList.less";
import { Collapse, Icon, Alert } from "antd";
import http from "../../../utils/api";
const { Panel } = Collapse;
const noticeId = "620317621824";

class NoticeList extends Component {
  state = {
    collapsed: false,
    imageUrl: "",
    userInfo: {},
    currentNotice: [],
    historyNotice: []
  };
  componentDidMount = async () => {
    let res;
    const current = [],
      history = [];
    let data = { current, history };
    const arr = [1, 2, 3, 4, 5];
    console.log("data ");
    data = [arr[0], ...arr];
    console.log("res", data,current, history);
    try {
      res = await http().getTable({
        resid: noticeId
      });
      // current =

      this.setState({
        currentNotice: res.data
      });
    } catch (error) {}
  };
  render() {
    const customPanelStyle = {
      background: "#f7f7f7",
      borderRadius: 4,
      marginBottom: 24,
      border: 0,
      overflow: "hidden"
    };
    const text = `
    A dog is a type of domesticated animal.
    Known for its loyalty and faithfulness,
    it can be found as a welcome guest in many households across the world.
  `;
    return (
      <div className="noticeList">
        <h2>最新通知</h2>
        <Alert
          message="Informational Notes"
          description="Additional description and information about copywriting."
          type="info"
          showIcon
          closeText="Close Now"
        />
        <div className="noticeList-line"> </div>
        <h3>历史通知</h3>
        <Collapse
          bordered={false}
          defaultActiveKey={["1"]}
          expandIcon={({ isActive }) => (
            <Icon type="caret-right" rotate={isActive ? 90 : 0} />
          )}
        >
          <Panel
            header="This is panel header 1"
            key="1"
            style={customPanelStyle}
          >
            <p>{text}</p>
          </Panel>
          <Panel
            header="This is panel header 2"
            key="2"
            style={customPanelStyle}
          >
            <p>{text}</p>
          </Panel>
          <Panel
            header="This is panel header 3"
            key="3"
            style={customPanelStyle}
          >
            <p>{text}</p>
          </Panel>
        </Collapse>
      </div>
    );
  }
}

export default NoticeList;
